INSERT INTO `lessons` VALUES (541,165,7,'Үлкен ақшаға ниеттену техникасы','<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">Сізге қазір өміріңіздің сәулелі жақтарын жақыннан көретін ғажайып медитация ұсынбақшымын. Нәтижесі болатынына сеніңіз. Істің басы жақсы ниетте ғой. Құдайсыз қурай да сынбайды. Сондықтан да Алла разылығы үшін деп ниет етіп, қандай да істі бастағанда сізді жын-шайтаннан, қауіп-қатерден сақтайтын Аятуль-күрсі сүресін тыңдағаныңыз дұрыс болады.</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/Qgnq_mMsA30\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">видеоны көрген болсаңыз</span></p>\r\n<p><span style=\"color: #ffffff;\">үй тапсыриһмасы;лстылтмо</span></p>\r\n<p><span style=\"color: #ffffff;\">сссссссссссссс</span></p>\r\n<p><span style=\"color: #ffffff;\">сссссссссссссссссссссссссссс</span></p>','',NULL,'uploads/1639034008dmL1z.jpg','[\"uploads/1639163194tgD27.mp3\"]',NULL,69,1,NULL,1,'2021-12-09 07:13:28','2021-12-11 05:23:09'),(542,165,14,'договор','<p><span style=\"color: #ffffff;\">договорды мұқият оқып, келіссеңіз \"КЕЛІСЕМІН\" деп жазыңыз</span></p>','',NULL,NULL,NULL,NULL,17,1,NULL,1,'2021-12-09 07:16:57','2021-12-11 05:03:43'),(543,166,27,'Договор','<p><span style=\"color: #ffffff;\">Договорды өзіңізге жүктеп, мұқият оқып шығыңыз. Мұқият танысып шыққаннан кейін төменгі жақта тұрған \"комментарии\" деген&nbsp; орынға \"КЕЛІСЕМІН\"-деп жазыңыз. Жауабыңыз қабылданғаннан кейін, сізге сабаққа доступ ашылады.</span></p>','',NULL,NULL,NULL,NULL,9,1,NULL,1,'2021-12-09 15:53:17','2021-12-10 06:45:27'),(544,167,29,'Қызмет прогреві','<p><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/Qgnq_mMsA30\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>Ақша</p>','',NULL,NULL,NULL,NULL,7,1,NULL,1,'2021-12-09 16:10:23','2021-12-10 12:11:12'),(545,165,7,'Таныстыру','<p><span style=\"color: #ffffff;\">2-ші сабаққа қош келдіңі<span style=\"color: #993366;\"><span style=\"caret-color: #993366;\">з</span></span></span></p>','',NULL,'uploads/16391137753h49B.jpeg',NULL,NULL,4,1,NULL,1,'2021-12-10 05:22:55','2021-12-10 19:14:43');
