INSERT INTO `question_answers` VALUES (74,'\"Логин-пароль қате\"-деп шығады. не істеу керек?','Сізге куратор логин-парольді қалай берді, тура солай жазыңыз. \r\nНомер жазғанда автоматты түрде шыққан \"+7\" санын өшіріп тастаңыз.\r\nОның орнына \"8xxxxxxxxxx\"-деп теріңіз.','2021-11-30 14:41:41','2021-11-30 14:57:38'),(75,'Приложениеге 2 қондырғымен кіруге болады ма?','❌ ЖОҚ, БОЛМАЙДЫ. \r\nПриложение ішіндегі курстар заңды түрде қорғалған. \r\n? Егер сіз 1 аккаунтпен 2 қондырғыда кіретін болсаңыз, сізді автоматты түрде БЛОКҚА жіберуі мүмкін. \r\nАры қарай логиніңіз жарамсыз болып қалады. \r\nЕгер телефоныңыз бұзылып қалса, жоғалтып алсаңыз кураторға ескертіңіз. \r\n✅ Тех-поддержкамен хабарласып, проблема шешілетін болады.','2021-11-30 14:46:09','2021-11-30 15:29:03'),(76,'Жаңа сабақтың ашылғанын қайдан білемін?','✅ \"INCON ACADEMY\" приложениесінен сізге жаңа сабақтың ашылғаны жайлы хабарландыру барады.','2021-11-30 14:47:45','2021-11-30 15:30:58'),(77,'Сабақтарды көре алмай жатырмын?','?‍♀️ \"Кіре алмай жатырмын, приложениеден шығып кетіп жатыр, сабақтар көрінбейді\" - деген сұрақтарға ТЕХ-ПОДДЕРЖКА бөлімі жауап береді. \r\n✅ Кез-келген техникалық сұраққа жауап ала аласыз:\r\n\r\n8-702-730-99-34','2021-11-30 14:52:17','2021-11-30 15:33:30'),(78,'Сабақтарды көру үшін сатып аламын ба?','Приложениеде 2 бөлім бар: \"АҚЫЛЫ\" және \"БОНУС\". \r\n\r\n✅ Тегін, бонусқа берілген сабақтарды \"БОНУС\" бөлімінен ешқандай төлем жасамай көре аласыз. \r\n? Ал ақылы сабақтарды сатып алып, төлем жасап \"АҚЫЛЫ\" бөлімінен көре аласыз.','2021-11-30 14:54:42','2021-11-30 15:32:27');
/*!40000 ALTER TABLE `question_answers` ENABLE KEYS */;
